import tkinter as tk
from PIL import Image, ImageTk
import random
import threading
import time
import base64
import io

windows = []
lock = threading.Lock()
running = True

# Embedded image data (Base64)
# Replace the content of IMAGE_DATA with the full base64 string of your image
IMAGE_DATA = b""""""

# Decode the image from Base64
loaded_image = Image.open(io.BytesIO(base64.b64decode(IMAGE_DATA))).resize((200, 150), Image.LANCZOS)

def create_window():
    new_window = tk.Toplevel(root)
    new_window.title("Jaruri nahi... 😂")
    new_window.attributes('-alpha', 0.95)

    def on_closing():
        with lock:
            if running:
                for _ in range(3):  # Spawn a few more
                    create_window()

    new_window.protocol("WM_DELETE_WINDOW", on_closing)

    # Position randomly
    screen_width = new_window.winfo_screenwidth()
    screen_height = new_window.winfo_screenheight()
    x = random.randint(0, screen_width - 200)
    y = random.randint(0, screen_height - 150)
    new_window.geometry(f"200x150+{x}+{y}")

    # Image per window to prevent garbage collection issues
    tk_image = ImageTk.PhotoImage(loaded_image)
    label = tk.Label(new_window, image=tk_image)
    label.image = tk_image
    label.pack(fill="both", expand=True)

    # Movement variables
    new_window.dx = random.choice([-5, 5])
    new_window.dy = random.choice([-5, 5])

    with lock:
        windows.append(new_window)
    return new_window

def move_windows():
    screen_width = root.winfo_screenwidth()
    screen_height = root.winfo_screenheight()

    with lock:
        for window in windows:
            try:
                x, y = window.winfo_x(), window.winfo_y()
                new_x = x + window.dx
                new_y = y + window.dy

                if new_x <= 0 or new_x >= screen_width - window.winfo_width():
                    window.dx *= -1
                if new_y <= 0 or new_y >= screen_height - window.winfo_height():
                    window.dy *= -1

                window.geometry(f"200x150+{new_x}+{new_y}")
            except tk.TclError:
                continue

    if running:
        root.after(50, move_windows)

def window_spawner():
    while running:
        root.after(0, create_window)
        # time.sleep(1)  # Uncomment to slow down spawning

# Main root window hidden
root = tk.Tk()
root.withdraw()

create_window()
move_windows()

spawner_thread = threading.Thread(target=window_spawner, daemon=True)
spawner_thread.start()

try:
    root.mainloop()
except KeyboardInterrupt:
    pass
finally:
    with lock:
        running = False
        for window in windows:
            try:
                window.destroy()
            except tk.TclError:
                continue
